LatestAccountSnapsho_1.query:
q = load "${App.Datasets.FscDemoAccountSnapshot.FullyQualifiedName}";
q = group q by 'SnapshotDate';
q = foreach q generate 'SnapshotDate', daysBetween(toDate(substr('SnapshotDate', 1, 10), "yyyy-MM-dd"), now()) as 'H', count() as 'count';
q = order q by 'SnapshotDate' desc;
