KPIs_BoB_1.query:
account = load "${App.Datasets.FscDemoAccount.FullyQualifiedName}";
fin_account = load "${App.Datasets.FscDemoFinancialAccount.FullyQualifiedName}";
account_client = filter account by 'RECORDTYPENAME' != "Household";
account_household = filter account by 'RECORDTYPENAME' == "Household";

result_current = group account_client by all full, account_household by all full, fin_account by all;
result_current = foreach result_current generate count(account_client)+10 as '# Clients', count(account_household)+5 as 'Households', coalesce(sum(account_client.'AUM'),0)+100000 as 'AUM', coalesce(sum(account_client.'HELDAWAY'),0)-100000 as 'HeldAway', coalesce(sum(account_client.'AUM'),0) / (coalesce(sum(account_client.'HELDAWAY'),0) + coalesce(sum(account_client.AUM),0)) * 100 as 'WalletShare', coalesce(sum(fin_account.'BALANCE'),0) as 'TotalBalance';

account_snapshot = load "${App.Datasets.FscDemoAccountSnapshot.FullyQualifiedName}";
account_snapshot = filter account_snapshot by date('SnapshotDate_Year', 'SnapshotDate_Month', 'SnapshotDate_Day') in ["current month - 7 days".."1 month ago"];
account_snapshot_client = filter account_snapshot by 'RecordTypeName' != "Household";
account_snapshot_household = filter account_snapshot by 'RecordTypeName' == "Household";
fin_account_snapshot = load "${App.Datasets.FscDemoFinancialAccountSnapshot.FullyQualifiedName}";
fin_account_snapshot = filter fin_account_snapshot by date('SnapshotDate_Year', 'SnapshotDate_Month', 'SnapshotDate_Day') in ["current month - 7 days".."1 month ago"];

result_snapshot = group account_snapshot_client by all full, account_snapshot_household by all full, fin_account_snapshot by all;
result_snapshot = foreach result_snapshot generate count(account_snapshot_client) as 'Clients_1MonthAgo', count(account_snapshot_household) as 'Households_1MonthAgo', coalesce(sum(account_snapshot_client.'AUM'),0) as 'FinServ__AUM__c_1MonthAgo', coalesce(sum(account_snapshot_client.'HeldAway'),0) as 'HeldAway_1MonthAgo', coalesce(sum(account_snapshot_client.'AUM'),0) / (coalesce(sum(account_snapshot_client.'HeldAway'),0) + coalesce(sum(account_snapshot_client.AUM),0)) * 100 as 'WalletShare_1MonthAgo', coalesce(sum(fin_account_snapshot.'Balance'),0) as 'TotalBalance_1MonthAgo';
result = union result_current,result_snapshot;
result_final = group result by all;
result_final = foreach result_final generate sum('# Clients') as '# Clients', sum('Households') as 'Households', sum('AUM') as 'AUM', sum('HeldAway') as 'HeldAway', sum('TotalBalance') as 'TotalBalance', sum('WalletShare') as 'WalletShare', 
sum('Clients_1MonthAgo') as 'Clients_1MonthAgo', sum('Households_1MonthAgo') as 'Households_1MonthAgo', sum('FinServ__AUM__c_1MonthAgo') as 'FinServ__AUM__c_1MonthAgo', sum('HeldAway_1MonthAgo') as 'HeldAway_1MonthAgo', sum('TotalBalance_1MonthAgo') as 'TotalBalance_1MonthAgo', sum('WalletShare_1MonthAgo') as 'WalletShare_1MonthAgo', 
(sum('# Clients') - sum('Clients_1MonthAgo')) / sum('Clients_1MonthAgo') * 100 as 'Clients_Change_Percentage', (sum('Households') - sum('Households_1MonthAgo')) / sum('Households_1MonthAgo') * 100 as 'Households_Change_Percentage', (sum('AUM') - sum('FinServ__AUM__c_1MonthAgo')) / sum('FinServ__AUM__c_1MonthAgo') * 100 as 'AUM_Change_Percentage', (sum('HeldAway') - sum('HeldAway_1MonthAgo')) / sum('HeldAway_1MonthAgo') * 100 as 'HeldAway_Change_Percentage', (sum('TotalBalance') - sum('TotalBalance_1MonthAgo')) / sum('TotalBalance_1MonthAgo') * 100 as 'TotalBalance_Change_Percentage', (sum('WalletShare') - sum('WalletShare_1MonthAgo')) / sum('WalletShare_1MonthAgo') * 100 as 'WalletShare_Change_Percentage';
